VALUES ('4251347600262', 'Baies de goji', 'FR/ LA REINE DES SUPER-ALIMENTS — Dans leur région d\'origine en Chine et au Tibet, les baies de Goji sont, depuis des siècles, vénérées comme super-aliment et font partie intégrante de la cuisine, de la nutrition et de la médecine. Nos baies de Goji séchées biologiques de qualité supérieure sont cultivées dans le plateau Qinghai au Tibet. Elles contiennent entre autres, des vitamines C et B2, du fer, du magnésium et du calcium. Les baies de Goji accompagnent parfaitement vos céréales, salades et yaourts ! A conserver dans un endroit frais et sec.', 'https://static.openfoodfacts.org/images/products/425/134/760/0262/front_fr.12.400.jpg', '2.7', '0.5', '55', '49.5', '11', '11.8', '1.24', '0.488188976377953', '', '0');

